import './Resume.css'
import { useState, useEffect } from 'react'

const Resume = () => {

    const [experience, setExperience] = useState(null);

    useEffect(() => {
        fetch('http://portfolio-ishubham21.vercel.app/experience', {
            mode: 'no-cors'
        })
        .then(res => res.json())
        .then(data => {
            console.log(data);
            setExperience(data)
        })
        .catch(err => console.error('Error encountered while fetching the data ' + err))
    }, [])

    return (
        <div className="resume-container">
            <div className="resume-sub-container">
                <div className="resume-blk"></div>
                <h2 className="resume-head">Resume</h2>
                <div className="position-section">
                    <div className="section-divider">
                        <h3>Experience</h3>
                        <a href="http://google.com" target="_blank" rel="noreferrer">
                            <button>
                                DOWNLOAD CV
                            </button>
                        </a>

                    </div>
                </div>
            </div>
        </div>
    );
}

export default Resume;
